public ApplicationId getApplicationId() {
  if (this.appId != null) {
    return this.appId;
  }

  GetTimelineCollectorContextRequestProtoOrBuilder p = viaProto ? proto : builder;
  if (!p.hasAppId()) {
    return null;
  }

  this.appId = convertFromProtoFormat(p.getAppId());
  return this.appId;
}
